import React, { Component } from "react";

class Do extends Component {
  render() {
    let sub = `Submit`;
    let client = "Design";
    let text = `Graphic jfhbvskjdvhdxk.,mcnsdkj.cxvmndfkjcv,mbn dfkcj,mnb fdjk Web`;
    client === "Design" ? (
      <span>{text.split(" ")[text.indexOf("Graphic")]}</span>
    ) : (
      <span>{text.split(" ")[text.indexOf("Graphic")]}</span>
    );
    return (
      <form className="m-5 p-5 border border-primary text-center">
        <p>{text}</p>
        <div className="mb-3 form-check">
          <input
            type="checkbox"
            className="form-check-input"
            id="exampleCheck1"
          />
          <label className="form-check-label" for="exampleCheck1">
            Facebook
          </label>
        </div>
        <div className="mb-3 form-check">
          <input
            type="checkbox"
            className="form-check-input"
            id="exampleCheck2"
          />
          <label className="form-check-labe2" for="exampleCheck2">
            YouTube
          </label>
        </div>
        <div className="mb-3 form-check">
          <input
            type="checkbox"
            className="form-check-input"
            id="exampleCheck3"
          />
          <label className="form-check-label" for="exampleCheck3">
            Instagram
          </label>
        </div>
        <button type="submit" className="btn btn-primary">
          {sub}
        </button>
      </form>
    );
  }
}

export default Do;
